ield--name-body field--type-text-with-summary field--label-hidden field__item\"><p>Strasbourg est la capitale de la rgion Alsace-Champagne-Ardenne-Lorraine (Grand Est) au nord-est de la France. Il s\'agit galement du sige officiel du Parlement europen. Situe prs de la frontire avec l\'Allemagne, la ville arbore une culture et une architecture aux influences allemandes et franaises. La cathdrale gothique Notre-Dame de Strasbourg propose des animations quotidiennes sur son horloge astronomique et une vue panoramique sur le Rhin  mi-hauteur de son clocher de 142 mtres de haut.</p></div>\n      \n  </div>\n</article>\n</div>\n    <div class=\"views-row\">\n<article data-history-node-id=\"2\" data-quickedit-entity-id=\"node/2\" role=\"article\" class=\"contextual-region node node--type-ville node--view-mode-teaser clearfix\" about=\"/eval-d8/web/ville/grenoble\">\n  <header>\n    \n            <h2 class=\"node__title\">\n        <a href=\"/eval-d8/web/ville/grenoble\" rel=\"bookmark\"><span data-quickedit-field-id=\"node/2/title/en/teaser\" class=\"field field--name-title field--type-string field--label-hidden\">Grenoble</span>\n</a>\n      </h2>\n        <div data-contextual-id=\"node:node=2:changed=1573122799&amp;langcode=en\" data-contextual-token=\"FmW_eq9df5p5B2nqGaqoZY98uXoxMMK4p0EQeDkbymQ\"></div>\n          <div class=\"node__meta\">\n        <article data-quickedit-entity-id=\"user/1\" class=\"contextual-region profile\" typeof=\"schema:Person\" about=\"/eval-d8/web/user/1\">\n  </article>\n\n        <span>\n          Submitted by <span data-quickedit-field-id=\"node/2/uid/en/teaser\" class=\"field field--name-uid field--type-entity-reference field--label-hidden\"><a title=\"View user profile.\" href=\"/eval-d8/web/user/1\" lang=\"\" about=\"/eval-d8/web/user/1\" typeof=\"schema:Person\" property=\"schema:name\" datatype=\"\" class=\"username\">Vho</a></span>\n on <span data-quickedit-field-id=\"node/2/created/en/teaser\" class=\"field field--name-created field--type-created field--label-hidden\">Wed, 11/06/2019 - 11:23</span>\n        </span>\n        \n      </div>\n      </header>\n  <div class=\"node__content clearfix\">\n      <div class=\"node__links\">\n    <ul class=\"links inline\"><li class=\"node-readmore\"><a href=\"/eval-d8/web/ville/grenoble\" rel=\"tag\" title=\"Grenoble\" hreflang=\"en\">Read more<span class=\"visually-hidden\"> about Grenoble</span></a></li></ul>  </div>\n\n            <div data-quickedit-field-id=\"node/2/field_photo/en/teaser\" class=\"field field--name-field-photo field--type-image field--label-hidden field__item\">  <img src=\"/eval-d8/web/sites/default/files/styles/medium/public/2019-11/Grenoble.jpg?itok=k3eLebdv\" width=\"220\" height=\"121\" alt=\"Grenoble\" typeof=\"foaf:Image\" class=\"image-style-medium\" />\n\n\n</div>\n      \n            <div data-quickedit-field-id=\"node/2/body/en/teaser\" class=\"clearfix text-formatted field field--name-body field--type-text-with-summary field--label-hidden field__item\"><p>Grenoble, ville de la rgion Rhne-Alpes du sud-est de la France, se trouve au pied des montagnes entre le Drac et l\'Isre. Entoure de montagnes, elle est le lieu idal pour les sports d\'hiver. Elle compte aussi des muses, des universits et des centres de recherche. Les tlphriques sphriques appels \"les bulles\" relient la ville au sommet de la colline de La Bastille, qui doit son nom  la forteresse du XVIIIe sicle rige sur ses versants.</p></div>\n      \n  </div>\n</article>\n</div>\n    <div class=\"views-row\">\n<article data-history-node-id=\"1\" data-quickedit-entity-id=\"node/1\" role=\"article\" class=\"contextual-region node node--type-ville node--view-mode-teaser clearfix\" about=\"/eval-d8/web/ville/paris\">\n  <header>\n    \n            <h2 class=\"node__title\">\n        <a href=\"/eval-d8/web/ville/paris\" rel=\"bookmark\"><span data-quickedit-field-id=\"node/1/title/en/teaser\" class=\"field field--name-title field--type-string field--label-hidden\">Paris</span>\n</a>\n      </h2>\n        <div data-contextual-id=\"node:node=1:changed=1573134565&amp;langcode=en\" data-contextual-token=\"xXZ3OBAxo0G3pfshvTa2dE2r3eOKlrjCUbpg3C4IoSA\"></div>\n          <div class=\"node__meta\">\n        <article data-quickedit-entity-id=\"user/1\" class=\"contextual-region profile\" typeof=\"schema:Person\" about=\"/eval-d8/web/user/1\">\n  </article>\n\n        <span>\n          Submitted by <span data-quickedit-field-id=\"node/1/uid/en/teaser\" class=\"field field--name-uid field--type-entity-reference field--label-hidden\"><a title=\"View user profile.\" href=\"/eval-d8/web/user/1\" lang=\"\" about=\"/eval-d8/web/user/1\" typeof=\"schema:Person\" property=\"schema:name\" datatype=\"\" class=\"username\">Vho</a></span>\n on <span data-quickedit-field-id=\"node/1/created/en/teaser\" class=\"field field--name-created field--type-created field--label-hidden\">Wed, 11/06/2019 - 11:13</span>\n        </span>\n        \n      </div>\n      </header>\n  <div class=\"node__content clearfix\">\n      <div class=\"node__links\">\n    <ul class=\"links inline\"><li class=\"node-readmore\"><a href=\"/eval-d8/web/ville/paris\" rel=\"tag\" title=\"Paris\" hreflang=\"en\">Read more<span class=\"visually-hidden\"> about Paris</span></a></li></ul>  </div>\n\n            <div data-quickedit-field-id=\"node/1/field_photo/en/teaser\" class=\"field field--name-field-photo field--type-image field--label-hidden field__item\">  <img src=\"/eval-d8/web/sites/default/files/styles/medium/public/2019-11/Paris_0.jpg?itok=mjWD5-B8\" width=\"220\" height=\"138\" alt=\"Paris\" typeof=\"foaf:Image\" class=\"image-style-medium\" />\n\n\n</div>\n      \n            <div data-quickedit-field-id=\"node/1/body/en/teaser\" class=\"clearfix text-formatted field field--name-body field--type-text-with-summary field--label-hidden field__item\"><p>Paris, capitale de la France, est une grande ville europenne et un centre mondial de l\'art, de la mode, de la gastronomie et de la culture. Son paysage urbain du XIXe sicle est travers par de larges boulevards et la Seine. Outre les monuments comme la tour Eiffel et la cathdrale gothique Notre-Dame du XIIe sicle, la ville est rpute pour ses cafs et ses boutiques de luxe bordant la rue du Faubourg-Saint-Honor.</p></div>\n      \n  </div>\n</article>\n</div>\n\n    </div>\n  \n            <div class=\"view-footer\">\n      <a href=\"/eval-d8/web/ville?theme=Les_villes_de_France\" class=\"views-display-link views-display-link-page_1\">Show more</a>\n    </div>\n    </div>\n</div>\n\n    </div>\n  </div>\n\";}s:9:\"#attached\";a:2:{s:7:\"library\";a:8:{i:0;s:18:\"views/views.module\";i:1;s:11:\"classy/node\";i:2;s:11:\"classy/node\";i:3;s:11:\"classy/node\";i:4;s:18:\"views/views.module\";i:5;s:11:\"classy/node\";i:6;s:11:\"classy/node\";i:7;s:11:\"classy/node\";}s:14:\"drupalSettings\";a:0:{}}s:6:\"#cache\";a:3:{s:8:\"contexts\";a:6:{i:0;s:26:\"languages:language_content\";i:1;s:28:\"languages:language_interface\";i:2;s:5:\"theme\";i:3;s:8:\"timezone\";i:4;s:21:\"user.node_grants:view\";i:5;s:16:\"user.permissions\";}s:4:\"tags\";a:15:{i:0;s:10:\"block_view\";i:1;s:44:\"config:block.block.views_block__city_block_1\";i:2;s:31:\"config:filter.format.basic_html\";i:3;s:25:\"config:image.style.medium\";i:4;s:22:\"config:views.view.city\";i:5;s:6:\"file:2\";i:6;s:6:\"file:3\";i:7;s:6:\"file:4\";i:8;s:6:\"node:1\";i:9;s:6:\"node:2\";i:10;s:6:\"node:3\";i:11;s:9:\"node_list\";i:12;s:9:\"node_view\";i:13;s:6:\"user:1\";i:14;s:9:\"user_view\";}s:7:\"max-age\";i:-1;}}',-1,1573566265.807,1,'block_view config:block.block.views_block__city_block_1 config:filter.format.basic_html config:image.style.medium config:views.view.city file:2 file:3 file:4 node:1 node:2 node:3 node_list node_view rendered user:1 user_view','176'),('entity_view:block:views_block__city_block_1:[languages:language_interface]=en:[theme]=Les_villes_de_France:[user.permissions]=2e2c02925493e399e80fe761025fcafe95a4d10371939dd7a2c535b1d48977a