iews-row\">\n<article data-history-node-id=\"2\" data-quickedit-entity-id=\"node/2\" role=\"article\" class=\"contextual-region node node--type-ville node--view-mode-teaser clearfix\" about=\"/eval-d8/web/ville/grenoble\">\n  <header>\n    \n            <h2 class=\"node__title\">\n        <a href=\"/eval-d8/web/ville/grenoble\" rel=\"bookmark\"><span data-quickedit-field-id=\"node/2/title/en/teaser\" class=\"field field--name-title field--type-string field--label-hidden\">Grenoble</span>\n</a>\n      </h2>\n        <div data-contextual-id=\"node:node=2:changed=1573122799&amp;langcode=en\" data-contextual-token=\"FmW_eq9df5p5B2nqGaqoZY98uXoxMMK4p0EQeDkbymQ\"></div>\n          <div class=\"node__meta\">\n        <article data-quickedit-entity-id=\"user/1\" class=\"contextual-region profile\" typeof=\"schema:Person\" about=\"/eval-d8/web/user/1\">\n  </article>\n\n        <span>\n          Submitted by <span data-quickedit-field-id=\"node/2/uid/en/teaser\" class=\"field field--name-uid field--type-entity-reference field--label-hidden\"><a title=\"View user profile.\" href=\"/eval-d8/web/user/1\" lang=\"\" about=\"/eval-d8/web/user/1\" typeof=\"schema:Person\" property=\"schema:name\" datatype=\"\" class=\"username\">Vho</a></span>\n on <span data-quickedit-field-id=\"node/2/created/en/teaser\" class=\"field field--name-created field--type-created field--label-hidden\">Wed, 11/06/2019 - 11:23</span>\n        </span>\n        \n      </div>\n      </header>\n  <div class=\"node__content clearfix\">\n      <div class=\"node__links\">\n    <ul class=\"links inline\"><li class=\"node-readmore\"><a href=\"/eval-d8/web/ville/grenoble\" rel=\"tag\" title=\"Grenoble\" hreflang=\"en\">Read more<span class=\"visually-hidden\"> about Grenoble</span></a></li></ul>  </div>\n\n            <div data-quickedit-field-id=\"node/2/field_photo/en/teaser\" class=\"field field--name-field-photo field--type-image field--label-hidden field__item\">  <img src=\"/eval-d8/web/sites/default/files/styles/medium/public/2019-11/Grenoble.jpg?itok=k3eLebdv\" width=\"220\" height=\"121\" alt=\"Grenoble\" typeof=\"foaf:Image\" class=\"image-style-medium\" />\n\n\n</div>\n      \n            <div data-quickedit-field-id=\"node/2/body/en/teaser\" class=\"clearfix text-formatted field field--name-body field--type-text-with-summary field--label-hidden field__item\"><p>Grenoble, ville de la rgion Rhne-Alpes du sud-est de la France, se trouve au pied des montagnes entre le Drac et l\'Isre. Entoure de montagnes, elle est le lieu idal pour les sports d\'hiver. Elle compte aussi des muses, des universits et des centres de recherche. Les tlphriques sphriques appels \"les bulles\" relient la ville au sommet de la colline de La Bastille, qui doit son nom  la forteresse du XVIIIe sicle rige sur ses versants.</p></div>\n      \n  </div>\n</article>\n</div>\n    <div class=\"views-row\">\n<article data-history-node-id=\"1\" data-quickedit-entity-id=\"node/1\" role=\"article\" class=\"contextual-region node node--type-ville node--view-mode-teaser clearfix\" about=\"/eval-d8/web/ville/paris\">\n  <header>\n    \n            <h2 class=\"node__title\">\n        <a href=\"/eval-d8/web/ville/paris\" rel=\"bookmark\"><span data-quickedit-field-id=\"node/1/title/en/teaser\" class=\"field field--name-title field--type-string field--label-hidden\">Paris</span>\n</a>\n      </h2>\n        <div data-contextual-id=\"node:node=1:changed=1573134565&amp;langcode=en\" data-contextual-token=\"xXZ3OBAxo0G3pfshvTa2dE2r3eOKlrjCUbpg3C4IoSA\"></div>\n          <div class=\"node__meta\">\n        <article data-quickedit-entity-id=\"user/1\" class=\"contextual-region profile\" typeof=\"schema:Person\" about=\"/eval-d8/web/user/1\">\n  </article>\n\n        <span>\n          Submitted by <span data-quickedit-field-id=\"node/1/uid/en/teaser\" class=\"field field--name-uid field--type-entity-reference field--label-hidden\"><a title=\"View user profile.\" href=\"/eval-d8/web/user/1\" lang=\"\" about=\"/eval-